import React from 'react'

const Social = () => {
  return (
    <div className="home_social">
        <a href="https://github.com/keymarrow" className="home_social-icons" target="_blank" rel="noreferrer">
          <i class="uil uil-github"></i>
        </a>

        <a href="https://linkedin.com/in/patrick-kimaro-596bb5186/" className="home_social-icons" target="_blank" rel="noreferrer">
            <i class="uil uil-linkedin"></i>
        </a>

        <a href="https://twitter.com/iam_kimaro" className="home_social-icons" target="_blank" rel="noreferrer">
            <i class='bx uil-twitter'></i>
        </a>
    </div>
  );
};

export default Social;
